import avatar2 from "../component/assets/images/users/avatar2.jpg";
import React, { Component } from "react";
import { Serverurl, Serverurlimg } from "../Common/ServerUrl";
import axios from "axios";
import $ from "jquery";

export class GridBusinessUsers extends Component {
  constructor(props) {
    super(props);
    this.state = {
      userData: [],
    };
  }

  componentDidMount() {
    var token = `Bearer ${localStorage.getItem("token")}`;
    console.log("token in gridBusinessUsers is: ", token);

    axios({
      method: "get",
      url: Serverurl + "user_show",
      headers: {
        Authorization: `Bearer ${localStorage.getItem("token")}`,
      },
      config: {
        headers: { "Content-Type": "application/json" },
      },
    })
      .then((res) => {
        console.log("user_show api response.data is: ", res.data);

        this.setState({
          userData: res.data,
        });

        $(document).ready(function () {
          $("#datatable2").DataTable();
        });
      })
      .catch((err) => {
        console.log("Error from user_show api is: ", err);
      });
  }

  render() {
    return (
      <div>
        <div className="container">
          <div class="row justify-content-center">
            <div class="col-lg-11 col-sm-11">
              <div class="card">
                <div class="card-body table-responsive">
                  <div className="list-head-btn">
                    <div className="head">
                      <h4>Users List</h4>
                    </div>
                    <div class="button-align">
                      <a
                        href="/component/createBusinessUser"
                        type="button"
                        class="btn btn-danger waves-effect waves-light submit-button"
                      >
                        Add Customer
                      </a>
                    </div>
                  </div>
                  <div class="table-3">
                    <table id="datatable2" class="table">
                      <thead>
                        <tr>
                          <th>Name</th>
                          <th>User Name</th>
                          <th>Last Active</th>
                          <th>Sign Up</th>
                          <th>Email</th>
                          <th>Orders</th>
                          <th>Total Spend</th>
                          <th>AOV</th>
                          <th>Country/Region</th>
                          <th>City</th>
                          <th>Region</th>
                          <th>Postal Code</th>
                          <th>Actions</th>
                        </tr>
                      </thead>

                      <tbody>
                        <tr>
                          <td>Ghous</td>
                          <td>ghous123</td>
                          <td>25/8/2020</td>
                          <td>24/8/2020</td>
                          <td>abc@gmail.com</td>
                          <td>1</td>
                          <td>₨1,470.00</td>
                          <td>₨1,470.00</td>
                          <td>PK</td>
                          <td>North Karachi</td>
                          <td>SD</td>
                          <td>74500</td>
                          <td>
                            <div class="icon-pad">
                              <a href="/component/updateBusinessUser">
                                <i className="fas fa-pencil-alt"></i>
                              </a>
                              <a href="/component/ViewSystemBusinessUser">
                                <i className="fas fa-eye"></i>
                              </a>
                              <i className="fas fa-trash-alt"></i>
                            </div>
                          </td>
                        </tr>
                      </tbody>
                    </table>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default GridBusinessUsers;
